import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

export default function Education () {
  return (
    <View style={styles.container}>
      <Text style={styles.sectionTitle}>Education</Text>
      <View style={styles.educationItem}>
        <Text style={styles.degree}>Bachelor of Science in Computer Science</Text>
        <Text style={styles.university}>University Name</Text>
        <Text style={styles.date}>2016 - 2020</Text>
        <Text style={styles.thesisTopic}>Thesis: Lorem Ipsum Dolor Sit Amet</Text>
        <Text style={styles.techStack}>Tech Stack: React, Node.js, MongoDB</Text>
      </View>
      <View style={styles.educationItem}>
        <Text style={styles.degree}>Master of Science in Computer Engineering</Text>
        <Text style={styles.university}>University Name</Text>
        <Text style={styles.date}>2020 - 2022</Text>
        <Text style={styles.thesisTopic}>Thesis: Consectetur Adipiscing Elit</Text>
        <Text style={styles.techStack}>Tech Stack: Python, TensorFlow, AWS</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    paddingHorizontal: 20,
    paddingTop: 20,
  },
  sectionTitle: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  educationItem: {
    marginBottom: 20,
  },
  degree: {
    fontSize: 18,
    fontWeight: 'bold',
  },
  university: {
    fontSize: 16,
    color: '#666',
  },
  date: {
    fontSize: 14,
    color: '#999',
  },
  thesisTopic: {
    fontSize: 16,
    marginTop: 5,
  },
  techStack: {
    fontSize: 16,
    color: '#666',
  },
});
